package helloworld;

public class RelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

			    
			    // create variables
			    int a = 7, b = 11;

			    // == operator
			    System.out.println(a == b);  // false

			    // > operator
			    System.out.println(a > b);  // false

			    // < operator
			    System.out.println(a < b);  // true

			    // >= operator
			    System.out.println(a >= b);  // false

			    // <= operator
			    System.out.println(a <= b);  // true
	}

}
